/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `set_available` AFTER INSERT ON `book_returns` FOR EACH ROW BEGIN 
		IF NEW.bookID > 0
		THEN
			UPDATE books SET is_available = '1' WHERE books.bookID = NEW.bookID;
		END IF;
	END */;;
