/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `returned_books_counter` AFTER INSERT ON `book_returns` FOR EACH ROW BEGIN 
		IF NEW.bookID > 0
		THEN 
		UPDATE accounts SET no_returned_books = no_returned_books + 1 WHERE accounts.accountID = NEW.accountID;
		END IF;
	END */;;
