/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `check_availability` AFTER INSERT ON `checkout` FOR EACH ROW BEGIN 
		IF NEW.bookID > 0
		THEN
			UPDATE books SET is_available = '0' WHERE books.bookID = NEW.bookID;
		END IF;
	END */;;
