/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `borrowed_books_counter` AFTER INSERT ON `checkout` FOR EACH ROW BEGIN
		IF NEW.bookID > 0
		THEN
		UPDATE accounts SET no_borrowed_books = no_borrowed_books + 1 WHERE accounts.accountID = NEW.accountID;
		END IF;
	END */;;
